from sympy import isprime
def afind(startat=0, limit=10**9):
  pow47 = 47**startat
  for k in range(startat, limit+1):
    q, r = divmod(pow47+1, 48)
    if r == 0 and isprime(q): print(k, end=", ")
    pow47 *= 47
